import React from "react";
import { Redirect, useParams } from "react-router-dom";

export const Parametro = () => {
  const params = useParams();
  if (!params) {
    return <Redirect to="/"></Redirect>;
  }

  const handleReturn = () => {
    history.back();
  };

  return (
    <div>
      <button className="btn-primary" onClick={handleReturn}>
        Volver
      </button>
    </div>
  );
};
